  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Currituck
  NWR outlines activities and accomplishments during the 2002 calendar year. The report
  begins with an introduction to the Refuge. Highlights and weather conditions are
  summarized for the year. Information about monitoring and studies- including surveys
  and censuses and studies and investigations- is provided next. Habitat restoration
  and management projects are also covered; activities include fire management, and
  vegetation control. Fish and wildlife management are discussed next. The resource
  protection section provides an update on law enforcement. Information about public
  education and recreation is given including visitor services and outreach.\",\n\t\"owner_org\":
